WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Merhaba!

WordPress yönetim bölümünde, bir eklenti veya tema sitenizde ciddi bir soruna neden olduğunda bunu algılayan ve sizi bu otomatik e-posta ile bilgilendiren bir özellik bulunur.
###CAUSE###
İlk olarak, sitenize gidin (###SITEURL###) ve görünür herhangi bir sorun olup olmadığına bakın. Ardından, hatanın bulunduğu sayfayı (###PAGEURL###) açın ve görünür herhangi bir sorun olup olmadığına bakın.

###SUPPORT###

Siteniz bozuk görünüyorsa ve yönetim bölümüne normal şekilde erişemiyorsanız, artık özel bir WordPress "kurtarma modu" var. Bunu kullanarak, yönetim panonuzda güvenli bir şekilde oturum açarak başka araştırmalar yapabilirsiniz.

###LINK###

Sitenizi güvende tutmak için bu bağlantının süresi ###EXPIRES### içinde dolacak. Yine de bu konuda endişelenmeyin. Süresi dolduktan sonra sorun yeniden çıkarsa size e-posta ile yeni bir bağlantı gönderilir.

